import Header from '../components/header.js';
import Footer from '../components/footer.js';

function Contact()
{
    return(
        <>
        <Header />
        <div className='w-full relative h-[600px] relative flex flex-col items-center pl-10 pr-10 '>

            {/* PRIMA CASETA */}
            <div className='w-fit relative h-[200px] flex flex-col items-center top-[5px]'>
                <div className='text-right'>

                     {/* MESAJUL */}    <h1 className='text-black text-[42px] drop-shadow-3xl'>Bine ai venit,</h1>
                   {/* EMAILUL*/}     <small className='text-black drop-shadow-3xl'>email@email.com</small>

                </div>
            </div>



            {/* A DOUA CASETA */}
            <div className='max-[1440px]:w-fit w-2/4 relative h-fit rounded-3xl p-2 bg-[#c4c4c4] flex flex-col items-center top-5'>
                <div className='text-right'>

                     {/* MESAJUL */}    <h3 className='text-white text-[14px] sm:text-[16px] md:text-[20px] text-center drop-shadow-3xl'>Suntem extrem de bucuroși să te avem alături de noi în această comunitate pasionată de eleganță și precizie. Fiecare ceas pe care îl oferim este mai mult decât un simplu accesoriu; este o declarație de stil și o fereastră către un univers de artizanat de înaltă calitate.
                                        </h3>

                </div>
            </div>
    
<br />

            {/* A TREIA CASETA */}
            <div className='w-fit relative h-[200px] bg-purple-200 flex flex-col items-center top-[5px]'>
                <div className='text-right'>

                     {/* MESAJUL */}    <h1 className='text-black text-[42px] drop-shadow-3xl'>Bine ai venit,</h1>
                   {/* EMAILUL*/}     <small className='text-black drop-shadow-3xl'>email@email.com</small>

                </div>
            </div>

        </div>

        
        <Footer />
        </>
    )
}

export default Contact;
